// Use hash table for efficiency:
var trusted = Object.keys(certs).reduce(function(trusted, key) {
  var pem = certs[key];
  pem = pem.replace(/-----BEGIN CERTIFICATE-----/g, "");
  pem = pem.replace(/-----END CERTIFICATE-----/g, "");
  pem = pem.replace(/\s+/g, "");
  trusted[pem] = key;
  return trusted;
}, {});

function getTrusted(pem) {
  pem = pem + "";
  pem = pem.replace(/-----BEGIN CERTIFICATE-----/g, "");
  pem = pem.replace(/-----END CERTIFICATE-----/g, "");
  pem = pem.replace(/\s+/g, "");
  if (!Object.prototype.hasOwnProperty.call(certs, pem)) return;
  return certs[pem];
}

function getCert(name) {
  name = name.replace(/^s+|s+$/g, "");
  if (!Object.prototype.hasOwnProperty.call(trusted, name)) return;
  return trusted[name];
}

exports.certs = certs;
exports.trusted = trusted;
exports.getCert = getCert;
exports.getTrusted = getTrusted;
